    public class Trip {

        private ArrayList<double[]> descriptions;
        private ArrayList<Attraction> attractionList;
        private Country country;
        private String category;

        public Trip(String type)
        {
            attractionList = new ArrayList<Attraction>();
            descriptions = new ArrayList<double[]>();
        }
        public void addAttraction(Country c, Attraction newAttract, double[] attractDescription)
        {
            attractionList.add(newAttract);
            descriptions.add(attractDescription);
            country = c;
        }

        public ArrayList<Attraction> getAttractionList() {
            return attractionList;
        }

        public ArrayList<double[]> getDescriptions() {
            return descriptions;
        }
    }

